import React from "react";
import { useAuth0 } from "@auth0/auth0-react";
import { useNavigate } from "react-router-dom";
import "./Header.css";

function Header() {
  const { loginWithRedirect, isAuthenticated, logout, user } = useAuth0();
  const navigate = useNavigate();

  return (
    <header className="header">
      <h1 className="header-logo">Organ Tracker</h1>
      <nav className="header-nav">
        {!isAuthenticated ? (
          <>
            <button onClick={() => navigate("/")} className="nav-btn">Home</button>
            <button onClick={() => loginWithRedirect({ screen_hint: "signup", redirectUri: window.location.origin + "/dashboard" })} className="auth-btn">Login/Sign Up</button>
          </>
        ) : (
          <>
            <p>Welcome, {user.name}!</p>
            <button onClick={() => logout({ returnTo: window.location.origin })} className="auth-btn">Logout</button>
            <button onClick={() => navigate("/dashboard")} className="auth-btn">Go to Form</button>
          </>
        )}
      </nav>
    </header>
  );
}

export default Header;
